// 公共方法
const MBTIUtils = {
  /**
   * 获取MBTI类型的名称
   * @param {string} type MBTI类型代码
   * @return {string} MBTI类型名称
   */
  getTypeName(type) {
    return mbtiTypes[type] || "";
  },

  /**
   * 获取MBTI的全名（名称）
   * @param {string} type MBTI类型代码
   * @return {string} MBTI类型全名
   */
  getFullTypeName(type) {
    return mbtiTypes[type];
  },

  /**
   * 获取MBTI类型的图标
   * @param {string} type MBTI类型代码
   * @return {string} 图标URL
   */
  getTypeIcon(type) {
    return mbtiIconMap[type] || "";
  },

  /**
   * 获取MBTI类型的详细描述
   * @param {string} type MBTI类型代码
   * @return {string} 详细描述
   */
  getTypeDescription(type) {
    return typeDescriptions[type] || "";
  },

  /**
   * 获取MBTI类型的简短描述
   * @param {string} type MBTI类型代码
   * @return {string} 简短描述
   */
  getShortDescription(type) {
    return mbtiShortDesc[type] || `${type}型人格`;
  },

  /**
   * 获取MBTI类型的颜色主题
   * @param {string} type MBTI类型代码
   * @return {Object} 颜色主题对象
   */
  getColorScheme(type) {
    return mbtiColorSchemes[type] || mbtiColorSchemes.INTJ; // 默认使用INTJ的颜色
  },

  /**
   * 获取MBTI类型的认知功能栈
   * @param {string} type MBTI类型代码
   * @return {Array} 认知功能栈数组
   */
  getCognitiveFunctions(type) {
    return mbtiCognitiveFunctions[type] || [];
  },

  /**
   * 判断一个MBTI类型是否有效
   * @param {string} type MBTI类型代码
   * @return {boolean} 是否有效
   */
  isValidType(type) {
    return !!mbtiTypes[type];
  },
};

module.exports = {
  MBTIUtils,
  mbtiTypes,
  mbtiIconMap,
  typeDescriptions,
  mbtiShortDesc,
  mbtiColorSchemes,
  mbtiCognitiveFunctions,
};
